  input: '"TEXT","F3A","","This amendment is in response to the Commission?s letter
    dated September 28, 2007.  Regarding the recount of the 2006 general election,
    the Commission through advisory opinion addressed the financing not simply of
    candidate activities in connection with recounts themselves, but also in connection
    with an ''election contest or related post-election litigation costs.''  Advisory
    Opinion 2006-24.  Filed pursuant to the Federal Contested Elections Act, the candidate''s
    contest of the 2006 general election remains pending  before the U.S. House of
    Representatives, and specifically before a task force of the Committee on House
    Administration.  At the direction of the task force, the General Accounting Office
    continues to review issues related to the performance of voting machines in Sarasota
    County, and their unexplained failure to count thousands of votes in the Congressional
    race.   Since the date referenced in your letter, the candidate has continued
    to incur significant expenses in connection with the House contest, as well as
    with parallel litigation initiated in Florida state court in November 2006.  The
